import styles from "./Input.module.css";

const Input = (props) => {
  const { src, alt, type, onChange, placeholder, value, inputClass, wrapperClass } = props;
  return (
    <div className={`${styles.inputWrapper} ${wrapperClass}`}>
      <input
        type={type}
        onChange={onChange}
        placeholder={placeholder}
        value={value}
        className={`${styles.inputField} ${inputClass}`}
        autoComplete="on"
      />
      <img src={src} alt={alt} className={styles.inputIcon} />
    </div>
  );
};

export default Input;
